import React from "react";

export default function Antipodal() {

    return (
        <div className="col-5 col-md-6 Antipodal">
            <h2 className="big">Antipode City</h2>
            <span><i className="fa-solid fa-rainbow big" /></span>
            <h2>
                <span>Temp </span>
                <span>Units</span>
            </h2>
        </div>
    );
  }
